import React from "react";
import Login from "./registeration/Login";
import Header from "./Header";
import Footer from "./Footer";
import { Divider, Typography } from "@mui/material";
import './Homepage.css';

function Homepage(props) {
    var isregister = props.isregister;
    handlecreate()
    {
        this.isregister=false

    }
    if(isregister) {
        return( 
            <div className="homepage">

                <Header />

                <div className="wrap">


                    <div className="fleft">


                    <div class="card">
                        <div class="card-content">
                            <Login/>

                            <Divider><Typography>or</Typography></Divider>
                            <br></br>
                            <button class="card-button" onClick={this.handlecreate}>Create Account</button>
                            <br/>
                            <br/>
                        </div>
                    </div>
                    </div>

                    <Divider orientation="vertical" flexItem className="vertical-divider" />

                    <div className="fright">Right</div>


                </div>

                <Footer />
            </div>
        );
    } else {
        return ( <Login />);
    }
}

export default Homepage;
